import { Avatar, Card } from "antd";

const UserProfile = () => {
  return (
    <>
      <Card
        actions={[
          <div key="twit">
            twit
            <br />0
          </div>,
          <div key="followings">followings</div>,
          <div key="followers">followers</div>,
        ]}
      >
        <Card.Meta title="Hyoil" avatar={<Avatar>H</Avatar>}></Card.Meta>
      </Card>
    </>
  );
};

export default UserProfile;
